import React from 'react';

const Approach = () => {
  const approachData = [
    { header: 'Header 1', paragraph: 'Paragraph 1' },
    { header: 'Header 2', paragraph: 'Paragraph 2' },
    { header: 'Header 3', paragraph: 'Paragraph 3' },
    { header: 'Header 4', paragraph: 'Paragraph 4' },
    { header: 'Header 5', paragraph: 'Paragraph 5' }
  ];

  return (
    <div>
      {approachData.map(data => (
        <div key={data.header}>
          <h3>{data.header}</h3>
          <p>{data.paragraph}</p>
        </div>
      ))}
    </div>
  );
}

export default Approach;
